import React from "react";

const Filterbar = () => {
  const today = new Date();
  return (
    <div>
      <div className="menu">
        <button> 드롭다운 </button>
      </div>
      <div>
        {today.getMonth() + 1}월{today.getDate()}일
      </div>
    </div>
  );
};

export default Filterbar;
